window.bookSummaryJSON = "<p><b>Globally best-selling </b><b><i>Divergent </i></b><b>author Veronica Roth delivers a breathtaking fantasy featuring an unusual&nbsp;friendship, an epic love story, and a galaxy-sweeping adventure. </b></p> <p><b>Number one </b><b><i>New York Times</i></b><b> best seller * </b><b><i>Wall Street Journal</i></b><b> best seller * </b><b><i>USA Today</i></b><b> best seller * Number one IndieBound best seller </b></p> <p>Praise for&nbsp;<i>Carve the Mark:</i></p> <p>“Roth skillfully weaves the careful world-building and intricate web of characters that distinguished&nbsp;<i>Divergent</i>.” (<i>VOYA</i>, starred review)</p> <p>“Roth offers a richly imagined, often brutal world of political intrigue and adventure, with a slow-burning romance at its core.” (ALA&nbsp;<i>Booklist</i>)</p> <p>Cyra Noavek and Akos Kereseth have grown up in enemy countries locked in a long-standing fight for dominance over their shared planet. When Akos and his brother are kidnapped by the ruling Noavek family, Akos is forced to serve Cyra, the sister of a dictator who governs with violence and fear. Cyra is known for her deadly power of transferring extraordinary pain unto others with simple touch, and her tyrant brother uses her as a weapon against those who challenge him. But as Akos fights for his own survival, he recognizes that Cyra is also fighting for hers, and that her true gift - resilience - might be what saves them both.</p> <p>When Akos and Cyra are caught in the middle of a raging rebellion, everything they’ve been led to believe about their world and themselves must be called into question. But fighting for what’s right might mean betraying their countries, their families, and each other.</p> <p>When the time comes, will they choose loyalty or love?</p> <p><b>This production includes a bonus excerpt from&nbsp;</b><b><i>The Fates Divide</i></b><b>, Veronica Roth's powerful follow-up novel performed by Austin Butler, Emily Rankin, Erin Spencer, and MacLeod Andrews!</b></p>"; 
